import { useStore } from "../store";
import { observer } from "mobx-react-lite";

export default observer(function AF_Inputs({ which, many }) {

    const { appStore } = useStore();

    if (which === "algo" && many === true) {
        return (
            <table className="bp4-html-table .modifier">
                <thead>
                    <tr>
                        <th>id</th>
                        <th>nazwa</th>
                    </tr>
                </thead>
                <tbody>
                    {appStore.algorithms.map(algo => (
                        <tr key={algo.id}>
                            <td>{algo.id}</td>
                            <td>
                                <label htmlFor={algo.name}>
                                    {algo.name}
                                </label>
                            </td>
                            <td>
                                <input type="checkbox" id={algo.name}></input>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        )
    }

    if (which === "func" && many === false) {
        return (
            <table className="bp4-html-table .modifier">
                <thead>
                    <tr>
                        <th>id</th>
                        <th>nazwa</th>
                    </tr>
                </thead>
                <tbody>
                    {appStore.functions.map(func => (
                        <tr key={func.id}>
                            <td>{func.id}</td>
                            <td>
                                <label htmlFor={func.name}>
                                    {func.name}
                                </label>
                            </td>
                            <td>
                                <input type="radio" id={func.id} name="func-one"></input>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        )
    }




})
